import toUrlEncoded from './toUrlEncoded';

const url = 'http://localhost:3000';

function postContactForm(data, successCallback, failCallback) {
  fetch(`${url}/contact`, {
    method: 'POST',
    body: JSON.stringify(data),
  })
  .then(successCallback)
  .catch(failCallback);
}

export default postContactForm;
